INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(1, 'Managing Software Development', 'Covers software life cycle models (waterfall, spiral, and so forth), domain engineering methods, requirements analysis methods (including formal specifications), software design principles and methods, verification and testing methods, resource and schedule estimation for individual software engineers, component-based software development methods and architecture, and languages for describing software processes. Includes a project where some of the software engineering methods (from domain modeling to testing) are applied in an example.', 'http://dummyimage.com/181x157.jpg/dddddd/000000', '500.00', 1, '4');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(2, 'The Complete Web Developer Course 2.0', 'Learn Web Development by building 25 websites and mobile apps using HTML, CSS, Javascript, PHP, Python, MySQL & more!', 'http://dummyimage.com/219x180.jpg/ff4444/ffffff', '200.00', 2, '5');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(3, 'JavaScript: Understanding the Weird Parts', 'An advanced JavaScript course for everyone! Scope, closures, prototypes, \'this\', build your own framework, and more.', 'http://dummyimage.com/178x121.jpg/5fa2dd/ffffff', '175.00', 2, '0');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(4, 'Learn and Understand AngularJS', 'Master AngularJS and the Javascript concepts behind it, design custom directives, and build a single page application.', 'http://dummyimage.com/135x242.bmp/5fa2dd/ffffff', '175.00', 2, '2');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(5, 'Webpack 2: The Complete Developer\'s Guide', 'Master Webpack 2 as you deploy web apps supported by Babel, code splitting, and ES2015 Modules.', 'http://dummyimage.com/156x149.jpg/cc0000/ffffff', '75.00', 2, '4');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(6, 'OS 11 & Swift 4 - The Complete iOS App Development Bootcamp', 'Learn iOS 11 App Development From Beginning to End. Using Xcode 9 and Swift 4. Includes Full ARKit and CoreML Modules!', 'http://dummyimage.com/171x121.jpg/ff4444/ffffff', '200.00', 3, '0');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(7, 'The Complete Android N Developer Course', 'Learn Android App Development with Android 7 Nougat by building real apps including Uber, Whatsapp and Instagram!', 'http://dummyimage.com/240x219.png/5fa2dd/ffffff', '200.00', 3, '0');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(8, 'Complete Python Bootcamp: Go from zero to hero in Python', 'Learn Python like a Professional! Start from the basics and go all the way to creating your own applications and games!', 'http://dummyimage.com/210x113.bmp/ff4444/ffffff', '195.00', 4, '2');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(9, 'Complete Java Masterclass', 'Learn to master Java 8 and Java 9 core development step-by-step, and make your first unique, advanced program in 30 days', 'http://dummyimage.com/207x200.png/ff4444/ffffff', '195.00', 4, '2');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(10, 'The Ultimate MySQL Bootcamp: Go from SQL Beginner to Expert', 'Become an In-demand SQL Master by creating complex databases and building reports through real-world projects', 'http://dummyimage.com/154x151.png/cc0000/ffffff', '180.00', 5, '1');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(11, 'The Complete Ethical Hacking Course: Beginner to Advanced!', 'Learn how to do ethical hacking, penetration testing, web testing, and wifi hacking using kali linux!', 'http://dummyimage.com/206x135.bmp/5fa2dd/ffffff', '200.00', 6, '3');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(12, 'Practical PLC Programming (PLC II)', 'This course will give an intermediate-level student the experience necessary to originate complex, logical solutions.', 'http://dummyimage.com/206x222.jpg/cc0000/ffffff', '100.00', 7, '0');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(13, 'Linux Administration Bootcamp: Go from Beginner to Advanced', 'Learn Red Hat Linux & CentOS: Use the in-demand skills to start a career as a Linux Server Admin or Linux Administrator!', 'http://dummyimage.com/214x100.png/5fa2dd/ffffff', '200.00', 8, '0');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(14, 'Beginning Project Management: Project Management Level One', 'This course is designed for people that are new to project management. This course is structured to give you a solid foundation of project management and to help you speak the project management language._', 'http://dummyimage.com/120x220.bmp/dddddd/000000', '100.00', 9, '0');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(15, 'Microsoft Excel for Project Management_', 'n this course we?re going to explore lots of things that Microsoft Excel can do for project management._', 'http://dummyimage.com/190x190.bmp/ff4444/ffffff', '100.00', 9, '0');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(16, 'Machine Learning', 'With every tutorial you will develop new skills and improve your understanding of this challenging yet lucrative sub-field of Data Science.', 'http://dummyimage.com/248x145.jpg/cc0000/ffffff', '200.00', 10, '0');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(17, 'Foundations of Biology', 'In this course you will learn the concepts of General Biology from two complementary perspectives._', 'http://dummyimage.com/206x162.png/ff4444/ffffff', '75.00', 11, '0');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(18, 'Basic Concepts of Biology From Start to Finish_', 'You will gain the knowledge you need for academic and professional development and to learn how Biology relates to day to day living.', 'http://dummyimage.com/182x167.png/dddddd/000000', '150.00', 11, '0');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(19, 'Lectures on Greek History and Culture', 'We start with a look at the physical world of the Greeks, and then take up the Iliad of Homer. After that we look in detail how Herodotus presents the beginning of the great conflict between Greece and Persian, and finish up with an overview of the various Greek philosophers.', 'http://dummyimage.com/249x239.jpg/5fa2dd/ffffff', '300.00', 12, '0');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(20, 'A Brief History of India.', 'Explore 5000 years of Indian history visually.', 'http://dummyimage.com/207x244.jpg/dddddd/000000', '75.00', 12, '0');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(21, 'Art History Prehistory to the Renaissance', 'This is a clear concise series of Art History lectures that cover the major works of painting, sculpture, and architecture.__', 'http://dummyimage.com/235x240.jpg/dddddd/000000', '175.00', 12, '0');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(22, 'Practical Sales Techniques', 'This course covers everything you need to know about sales: from preparing and planning, relationship building, objection handling techniques, and closing the deal at a brilliant price. It looks at lots of real life examples (some of which will definitely get you laughing) and gives practical tools you can use right away to get better results.', 'http://dummyimage.com/182x166.jpg/ff4444/ffffff', '350.00', 13, '2');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(23, 'Conflict Management with Emotional Intelligence', 'This course is a standalone course for anyone interested in understanding how to manage, work with and resolve conflict. It compliments other courses that explore_emotional intelligence_in more depth.', 'http://dummyimage.com/107x221.jpg/ff4444/ffffff', '300.00', 13, '1');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(24, 'Data Science, Deep Learning & Machine Learning with Python', 'The topics in this course come from an analysis of real requirements in data scientist job listings from the biggest tech employers. We\'ll cover the machine learning and data mining techniques real employers are looking for.', 'http://dummyimage.com/147x210.jpg/dddddd/000000', '200.00', 14, '0');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(25, 'Master Google Sheets', 'This class is guaranteed to teach you Google Spreadsheets.', 'http://dummyimage.com/237x171.png/cc0000/ffffff', '175.00', 14, '1');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(26, 'Foundations of Psychology', 'Surveys the fundamental principles, concepts, and issues in the major areas of contemporary scientific psychology. Approaches the study of psychology as a method of inquiry as well as a body of knowledge._', 'http://dummyimage.com/250x199.jpg/dddddd/000000', '300.00', 15, '0');
INSERT INTO `Course` (`CourseId`, `Name`, `Description`, `Icon`, `Cost`, `TopicId`, `AvgRating`) VALUES(27, 'Drugs and Behavior', 'Provides beginning students with a general overview of the effects of drug use/abuse in many segments of society with particular attention placed on the collegiate population', 'http://dummyimage.com/163x168.bmp/5fa2dd/ffffff', '275.00', 15, '0');
